inline void solve(int nx,int ny,int rem){
    int nowx,nowy,*p,*pat=&tab[nx][ny];

    nowx=nx;nowy=ny;
    p=pat;
LA:
   nowx++;
   if(nowx>=wx) goto LB;
   p+=10;
   if(*p==2&&rem==0)ans++;
   else if(*p==1){
       *p=-1;
       solve(nowx,nowy,rem-1);
       *p=1;
       goto LB;
   }
   goto LA;
LB:         

    nowx=nx,nowy=ny;
    p=pat;
MA:
   nowx--;
   if(0>nowx) goto MB;
   p-=10;
   if(*p==2&&rem==0)ans++;
   else if(*p==1){
       *p=-1;
       solve(nowx,nowy,rem-1);
       *p=1;
       goto MB;
   }
   goto MA;
MB:         

    nowx=nx,nowy=ny;
    p=pat;
NA:
   nowy++;
   if(nowy>=wy) goto NB;
   p++;
   if(*p==2&&rem==0)ans++;
   else if(*p==1){
       *p=-1;
       solve(nowx,nowy,rem-1);
       *p=1;
       goto NB;
   }
   goto NA;
NB:        

    nowx=nx,nowy=ny;
    p=pat;
OA:
   nowy--;
   if(0>nowy) return;
   p--;
   if(*p==2&&rem==0)ans++;
   else if(*p==1){
       *p=-1;
       solve(nowx,nowy,rem-1);
       *p=1;
       return;
   }
   goto OA;
}
